var Cars = /** @class */ (function () {
    function Cars(name, imgSrc, year) {
        this.name = name;
        this.imgSrc = imgSrc;
        this.year = year;
    }
    Cars.prototype.getAge = function () {
        return new Date().getFullYear() - this.year;
    };
    return Cars;
}());
var carsArray = [
    new Cars("skoda", "data:image/png;base64,", 2017),
    new Cars("BMW", "data:image/jpeg;base64,", 2020),
    new Cars("chevrolet", "data:image/jpeg;base64,", 2023),
    new Cars("mersedes", "data:image/jpeg;base64,", 2021),
];
// const carsArray = [skoda, BMW, chevrolet, mersedes];
var renderyCars = document.querySelector("#carsNames");
var carsToHtml = carsArray
    .map(function (car) {
    return "<p>car Type: " + car.name + ", Img Symbol: <img src=\"" + car.imgSrc + "\" />, age: " + car.getAge() + "</p>";
})
    .join(" ");
if (renderyCars) {
    renderyCars.innerHTML = carsToHtml;
}
